import React, { useEffect, useState } from 'react'

const Users = () => {
  let[user,SetUser]=useState([])
  useEffect(()=>{
    let fetchUser=async()=>{
      let userData=await fetch(`http://localhost:4000/users`)
      .then(resp=>resp.json())
      SetUser(userData)
    }
    fetchUser()
  },[user]);
  let{id,firstname,email,phone,address,birthDate}=user
  return (
    <>
    
    
    <div className="users">

   
      
      
      <table border={1}>
        <thead>
          <tr>
            <th>id</th>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Email Id</th>
            <th>Phone</th>
            <th>Address</th>
            <th>Date</th>
          </tr>


        </thead>
        <tbody>

        </tbody>
      </table>
    </div>
    
    
    
    </>
  )
}

export default Users
